import React from 'react';
import { Card } from 'react-bootstrap';

const Todo = (props) => {
    const {id,title,desc}=props.todo;
  return (
    <Card>
        <Card.Header>
        {title}
        </Card.Header>
        <Card.Body>
        <p>{desc}</p>
        </Card.Body>
     
    </Card>
  )
}

export default Todo
